INSERT INTO [dbo].[TIPO_ACCIDENTE]
           (ID_TIPO, [CODIGO],[DESCRIPCION])
     VALUES
           (1, 'lesion en actividad fisica deportiva', 'Es el accidente sufrido por el trabajador en eventos deportivos organizados o patrocinados por el empleador'),
		   (2, 'lesion en actividad recreativa', 'Es el accidente ocurrido en el desarrollo de actividades recreativas, deportivas o culturales organizadas y financiadas por el empleador '),
		   (3, 'lesion por violencia', 'Es el accidente que ocurre como consecuencia del uso intencional de la fuerza o el poder físico, de hecho o como amenaza, contra otra persona o comunidad'),
		   (4, 'lesion por accidente de transito', 'Suceso que se produce en vía pública o privada e involucra al menos un vehículo en movimiento'),
		   (5, 'atrapamiento', '	Es el accidente que ocasiona atrapamiento o arrastre de ropas o de partes del cuerpo de una persona por dos o más componentes móviles'),
		   (6, 'caida de altura', 'Es el accidente que se genera por cualquier caída de un trabajador desde una altura física mayor o igual a 1,50 metros'),
		   (7, 'Biologico', 'Es el que ocurre por contacto con agentes biológicos micro y macroorganismos como: virus, bacterias, hongos, parásitos'),
		   (8, 'caida de objeto', 'Es el accidente que ocurre al caer un objeto desde un nivel superior al nivel en el cual se encuentra el trabajador y lo golpea en alguna de las partes del cuerpo.'),
		   (9, 'Intoxicacion alimentaria', 'es la manifestación clínica ocasionada por la ingestión de alimentos o agua contaminados por bacterias, parásitos, virus o las toxinas producidos por estos microorganismos, o por agentes químicos'),
		   (10, 'Postura forzada o movimiento brusco y/o fallido', ' se genera por posiciones de trabajo que supongan que una o varias regiones anatómicas dejen de estar en una posición natural de confort para pasar a una posición forzada'),
		   (11, 'Sobreesfuerzo muscular', ' accidente asociado a la Manipulación Manual de cargas; la cual se entiende por cualquier actividad que requiera el uso de fuerza humana'),
		   (12, 'Cortes por o contra objetos', 'accidente que ocurre cuando alguna parte del cuerpo de un trabajador entra en contacto con objetos cortantes, punzantes o abrasivos'),
		   (13, 'Pisadas, choques o golpes', 'Es el accidente que ocurre mediante un impacto entre la persona lesionada y el agente de la lesión. Puede ser que el movimiento que produce el contacto es primordialmente el del objeto y no el de la persona'),
		   (14, 'Exposición con temperaturas extremas', 'accidente en el que el trabajador se lesiona por contacto con superficies o productos calientes o fríos'),
		   (15, 'Exposición o contacto con electricidad', 'accidente en el que el trabajador resulta lesionado por contacto directo con partes activas en tensión (energías o corriente eléctrica)'),
		   (16, 'Exposición o contacto con sustancias químicas', 'Es el accidente en el que el trabajador resulta afectado en su salud por efectos de inhalación, contacto dérmico o ingestión de productos o sustancias químicas'),
		   (17, 'Sofocamiento mecánico', 'Es el accidente en el que el trabajador presenta una alteración mecánica para el ingreso del aire a los pulmones'),
		   (18, 'Otro', 'accidente en el que el trabajador resulta lesionado física y/o psicológicamente');
