           (13, '01-24-2019 15:35:22', 'el trabajador se encontraba realizando su labor habitual, se enredo con un de los tubos y le ocaciono una herida en el dedo menique de la mano izquierda, sufrio fractura', 'area de montaje', 'al parecer los tubos estaban mal sugetados, es estonces que decidi arrinconarlos un poco, entonces el alambre que sostenia los tubos se solto e intente agarrarlos, ahi es donde uno de los tubos me golpeo.'),
		   (15, '01-05-2019 15:35:22', 'Durante la realización de los trabajos en el exterior de la obra, el trabajador fue al poste de luz, creyendo que se había cortado el suministro eléctrico en el interior del mismo. El accidentado recibió una descarga eléctrica al contactar con el embarrado de la celda', 'entrada a la obra', ''),
		   (6, '01-05-2019 15:35:22', 'El trabajador cayó por el hueco del edificio desde la tercera planta cuando trataban de descender una saca que contenía varias piezas de máquina.', 'obra gruesa tercer piso', ''),
		   (5, '01-05-2019 15:35:22', 'Cuando realizaba uno de los taladros, al acercar la mano para apartar la viruta, el taladro enganchó el guante y la mano y el brazo fueron arrastrados hacia la maquina.', 'obra gruesa', 'el guante quedo enganchado en el taladro, creo q los guantes que me traje eran muy viejos'),
		   (4, '01-05-2019 15:35:22', 'Al realizar un giro muy cerrado para recoger materiales detrabajo el operario cayó de la estribera al suelo, sufriendo un fuerte golpe en la cabeza', 'camion de transporte', ''); 
